import styled, { css } from "styled-components";

export const CollectionContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

export const CollectionItemsContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
`;
